// client/src/components/UploadedFile.js
import React from 'react';

const UploadedFile = ({ file }) => {
  if (!file) {
    return null;
  }

  return (
    <div>
      <h2>Uploaded File</h2>
      <p>File Name: {file.name}</p>
      <p>File Size: {file.size} bytes</p>
      <p>File Type: {file.type}</p>
    </div>
  );
};

export default UploadedFile;
